import "react-native-gesture-handler";
import React from "react";
import { StatusBar } from "expo-status-bar";
import AuthPage from "./src/screens/AuthPage";
import FlashCard from "./src/screens/Flashcard";
import ListFlashCards from "./src/screens/ListFlasCards";
import { enableScreens } from "react-native-screens";

enableScreens();

import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name={"me-connecter"} component={AuthPage} />
        <Stack.Screen name={"mes-fiches"} component={ListFlashCards} />
        <Stack.Screen name={"une-fiche"} component={FlashCard} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
